import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { Credential } from '../../models/credential.class';
import '../../styles/forms.css';

const CredentialComponent = () => {
    const [fullName, setFullName] = useState('');
    const [personalID, setPersonalID] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
    }

    return (
        <div>
            <form className='c-form' onSubmit={handleSubmit}>
                <label>
                    Full Name:
                    <input type="text" value={fullName} onChange={event => setFullName(event.target.value)} />
                </label>
                <br />
                <label>
                    Personal ID:
                    <input type="text" value={personalID} onChange={event => setPersonalID(event.target.value)} />
                </label>
                <br />
                <input type="submit" value="Submit" />
            </form>

            <img class="img-info" src="https://th.bing.com/th/id/OIP.qHRrge25gpFW2Kthj4Qs2AHaHa?w=181&h=181&c=7&r=0&o=5&pid=1.7" alt="" />
        </div>
    );
}

CredentialComponent.propTypes = {
    fullName: PropTypes.instanceOf(Credential).isRequired,
    personalID: PropTypes.instanceOf(Credential).isRequired
};

export default CredentialComponent;
